import React, { useRef } from "react";

const ShowOrder = () => {
  const userId = useRef();
  const getUserOrder = (e) => {};
  return (
    <div className="modal-container ">
      <label>User id</label>
      <input type="text" ref={userId} />
      <button onClick={getUserOrder}>Get order</button>
    </div>
  );
};

export default ShowOrder;
